import React from 'react';
import './card.css'

class Card extends React.Component {
  render () {
    return (
    <div className="card">
      <img>{this.props.image}</img>
      <h1>{this.props.title}</h1>
      <h3>{this.props.technologies}</h3>
      <p>{this.props.description}</p>
      <p>Code</p>
      <p>Demo</p>
      
    </div>
  );
}
}

export default Card;
